(27, 1, 'cola-coco-co', 'water', 4, 200, '             Cola is a sweetened, carbonated soft drink, made from ingredients that contain caffeine from the kola nut and non-cocaine derivatives from coca leaves, flavored with vanilla and other ingredients. Most colas now use other flavoring (and caffeinating) ingredients with a similar taste. Cola became popular worldwide after pharmacist John Pemberton invented Coca-Cola in 1886.[1] His non-alcoholic recipe was inspired by the coca wine of pharmacist Angelo Mariani, created in 1863.[1] Modern colas usually contain caramel color, caffeine, and sweeteners such as sugar or high-fructose corn syrup. They now come in numerous different brands. Among them, the most popular are Coca-Cola and Pepsi-Cola. These two cola companies have been rivaling each other since the 1980s.\r\n             ', , '<iframe width=\"640\" height=\"360\" src=\"https://www.youtube.com/embed/OPi9nTE70aA\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>');
