INSERT INTO `products` (`id`, `Company_ID`, `name`, `product_type`, `price`, `product_quantity`, `about_product`, `image`, `video`) VALUES
(29, 2, '100plussss', 'water', 20, 39, '             100PLUS is sold in Singapore, Malaysia, Brunei, Thailand, Indonesia, the Philippines, Myanmar, Canada, Papua New Guinea, Maldives, India, Republic of Korea, Hong Kong, China, Taiwan and South Africa. It is sometimes available for purchase in other parts of the world, such as Australia and the United Kingdom (typically in Asian-speciality stores and/or aisles of large chain supermarkets). In Canada, 100PLUS is sold at all T&T Supermarkets in the province of British Columbia, Alberta and Ontario. The authorised distributor for Canada is Palm Resources Inc. 100PLUS is popular in Malaysia and Singapore. It has been consistently voted the number one isotonic drink brand in Malaysia in various surveys since its introduction in 1983.[2] In 2011, a non-carbonated version called 100PLUS Edge was introduced in addition to the four existing variations: Original, Tangy Tangerine, Lemon Lime, Berries and Active. One of its main competitors in Singapore is H-TWO-O, which is manufactured by Yeo Hiap Seng.\r\n             ', , '<iframe width=\"640\" height=\"360\" src=\"https://www.youtube.com/embed/y0OqHCgS_v4\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>');
